import React, { Component } from 'react';

class Counter extends Component {
    state = { 
        count : 0 ,
        tags : ['Elemen1','Element2','Element3']
     }
    render() { 
        return ( 
            <React.Fragment>
                <h1>Rendering array Items as list: </h1>
                <ul>{ this.state.tags.map(tag => <li key={tag}>{tag}</li>) }</ul>
            </React.Fragment>
         );
    }
}
 
export default Counter;
